import React from 'react';
import Pizza from '../components/Pizza';
import pizzas from '../pizzasdata';
import './NavBar'

export default function Homepage() {
    return (
        <div>
            <div className='row'>
                {pizzas.map(pizza => (
                    <div className='col-md-4 ' key={pizza.name}>
                        <div >
                        <Pizza pizza={pizza} />
                        
                
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}
